			      <p class="notencab-e2"> Con la definición del desafío de consolidar 
                    a la región de Coquimbo como el centro acuícola, turístico 
                    y agrícola de Chile, el intendente Felipe del Río entregó 
                    la Cuenta Pública de la Gestión 2003 del Gobierno en la Región, 
                    este jueves en el Nuevo Liceo Técnico Femenino de Las Compañías, 
                    en La Serena. </p></td></tr>
			 <tr><td height="15"></td></tr>
			 <tr><td><p class="noticia-e2" align="justify"> <img src="imagenes/cta_img01.png" title=" Intendente Felipe Del R&iacute;o, rindiendo cuenta p&uacute;blica en el Liceo T&eacute;cnico Femenino del Sector Las Compa&ntilde;&iacute;as, La Serena. " width="200" height="150" hspace="5" vspace="3" border="1" align="left" />Rodeado 
                    por representantes de todos los sectores que son partícipes 
                    de la gestión del Gobierno, tanto como beneficiarios y actores 
                    de lo realizado, el intendente Del Río entregó el balance 
                    de la gestión realizada durante el 2003 en la región de Coquimbo.</p>
			  <p class="noticia-e2" align="justify">
              La autoridad recalcó la importancia del diálogo como herramienta para el desarrollo, para consolidar lo que definió como los tres focos de desarrollo estratégico de la región en el ámbito económico: el desarrollo agrícola, de la acuicultura y del turismo.  “Cada vez es más nítido para todos nosotros, que nuestra región tiene una vocación específica.  Estamos llamados a ser el centro acuícola, agrícola y turístico de Chile para el mundo, sobre la base del emprendimiento, la innovación y la integración a nuevos mercados, porque tenemos un territorio con un potencial tremendo”, señaló Del Río durante su discurso.</p>
			  <p class="noticia-e2" align="justify">
              La interacción público – privada con un gran componente social, fue uno de los hitos recalcados por el Intendente, quien destacó el buen pie del diálogo con el sector privado reflejado en hitos como el viaje de una delegación de 120 empresarios, autoridades y académicos a la provincia de San Juan, en noviembre pasado.</p>
			  </td></tr>
            </table></td>
        </tr>
		<tr><td height="35"></td></tr>
        <tr> 
          <td>
		     <table width="100%" border="0" cellspacing="0" cellpadding="0">
             <tr> 
                <td height="45"><div class="centersecc"><img src="imagenes/secc02.png" width="450" height="25" /></div></td>
             </tr>
			 <tr><td><p class="noticia-e2" align="justify">
La preocupación por el desempleo, también marcó la Cuenta Pública, materia en la que el Gobierno está trabajando a través de la generación de emprendimientos a través de fondos concursables, y la preparación de las personas de la región de Coquimbo en áreas específicas relacionados con los focos de desarrollo definidos.</p>
			  <p class="noticia-e2" align="justify">
“El emprendimiento, la innovación y la integración a los nuevos mercados son un sello de nuestra gestión”, señaló Del Río, destacando que a través de una experiencia piloto de fondos concursables, 123 microempresarios de la región impulsaron ideas de negocio, el programa Proempresaria permitió que 41 mujeres fortalecieran sus proyectos de emprendimiento y, que otras 380 mujeres campesinas hicieran realidad sus sueños en el ámbito agrícola, a través de fondos de Indap y Prodemu, lo que significa que en la actualidad, todos esos hogares hoy cuenten con una mejor fuente de ingresos.</p>
			  </td></tr>
            </table></td>
        </tr>		


		<tr><td height="35"></td></tr>
        <tr> 
          <td>
		     <table width="100%" border="0" cellspacing="0" cellpadding="0">
             <tr> 
                <td height="45"><div class="centersecc"><img src="imagenes/secc03.png" width="450" height="25" /></div></td>
             </tr>
			 <tr><td><p class="noticia-e2" align="justify">
El tema de la infraestructura, también fue tocado por la autoridad, destacando las inversiones realizadas no sólo en caminos y vivienda, sino en desarrollo científico.  Por esto, la concreción del Centro de Estudios Avanzados en Zonas Áridas, el CEAZA, llevado adelante por la Universidad de La Serena, la Universidad Católica del Norte, el Centro del Agua y el Instituto de Investigación Agropecuaria, permitirá dar mayor sustento al empleo de los recursos hídricos de la región.</p>
			  <p class="noticia-e2" align="justify">
El tema de la construcción del aeropuerto regional, fue tocado como fundamental para posibilitar la salida de los productos regionales al extranjero.  “Es necesario generar una infraestructura portuaria – tanto marítima como aérea - acorde a los nuevos desafíos, a estos nuevos tiempos.  Hoy quiero pedirle a nuestros parlamentarios que nos apoyen para facilitar y atraer inversiones en el puerto de Coquimbo y para la construcción del aeropuerto regional Gabriela Mistral, iniciativas que aseguran una infraestructura básica para la integración de nuestra región al mundo”, señaló, agregando que no podemos seguir desperdiciando las posibilidades de crecimiento que se nos presentan.</p>
			  <p class="noticia-e2" align="justify">
Finalmente, el Intendente Del Río hizo un llamado a todas las fuerzas vivas de la región para aprovechar el capital humano existente y dar un salto cualitativo en la calidad de vida de la región.</p>
			  </td></tr>
